INSERT INTO `help_topics` VALUES (1,'journal_udk','УДК журнала','Укажите УДК журнала','Укажите УДК журнала',3,0,0,0,'2017-05-29 12:47:59','2017-05-31 08:26:07'),(2,'journal_issn','ISSN журнала','Укажите ISSN журнала','Укажите ISSN Вашего журнала. Порядок присвоения журнала указан на http://www.bookchamber.ru/issn.html',3,1,0,0,'2017-05-30 12:10:54','2017-05-31 08:26:13'),(3,'journal_properties','Свойства журнала','Основные настройки журнала в системе','В данном разделе Вы сможете узнать, каким образом настраивается журнал в системе Web-Сборник',0,18,0,0,'2017-05-31 08:25:05','2017-06-19 12:21:34'),(4,'journal_title','Название журнала','Укажите официальное название Вашего журнала','Укажите официальное название Вашего журнала. Данное название журнала будет отображаться на главной странице сайта.',3,2,0,0,'2017-05-31 08:31:16','2017-05-31 08:31:16'),(5,'journal_website','Вебсайт журнала','Укажите официальный адрес сайта Вашего журнала','Укажите официальный адрес сайта Вашего журнала. Предполагается, что на данном сайте пользователи смогут ознакомиться, к примеру, с архивными версиями Вашего журнала.',3,4,0,0,'2017-05-31 08:32:53','2017-05-31 08:32:53'),(6,'journal_descr','Описание журнала','Опишите Ваш журнал для потенциальных авторов','Дайте описание журналу, чтобы авторы смогли понять его направление и особенности.',3,5,0,0,'2017-05-31 08:36:16','2017-05-31 08:36:16'),(7,'journal_arules','Правила авторам','Загрузите файл с исчерпывающим перечнем правил для авторов. Правила будут едиными для всех выпусков журнала','Загрузите файл с исчерпывающим перечнем правил для авторов. Правила будут едиными для всех выпусков журнала. Формат файла не важен, как правило это файл формата .doc(x), .odt либо .pdf',3,6,0,0,'2017-05-31 08:37:25','2017-05-31 08:37:25'),(8,'journal_logo','Логотип журнала','Загрузите логотип журнала. Размеры - не менее 100 х 150. Пропорции - 2:3. Формат - .jpg либо .png','Загрузите логотип журнала. Размеры - не менее 100 х 150. Пропорции - 2:3. Формат - .jpg либо .png',3,7,0,0,'2017-05-31 08:38:48','2017-05-31 08:56:49'),(9,'publication_properties','Свойства выпуска журнала','Укажите основные настройки выпуска журнала','В данном окне Вы можете настроить основные опции очередного выпуска для Вашего журнала',0,3,0,0,'2017-05-31 08:41:04','2017-05-31 08:41:04'),(10,'publication_pubno','Номер выпуска журнала','Укажите номер (порядковое число) выпуска для журнала','Укажите номер (порядковое число) выпуска для журнала',9,0,0,0,'2017-05-31 09:46:57','2017-05-31 09:46:58'),(11,'publication_pubtxt','Название выпуска журнала','Укажите название выпуска, если оно имеется','Укажите название выпуска, если оно имеется',9,10,0,0,'2017-05-31 09:47:51','2017-05-31 09:47:51'),(12,'publication_ISBN','ISBN','Укажите ISBN выпуска журнала','Укажите ISBN выпуска журнала. Порядок присвоения номера ISBN указан здесь: http://www.bookchamber.ru/isbn.html',9,11,0,0,'2017-05-31 09:48:51','2017-05-31 09:48:51'),(13,'publication_status_id','Статус выпуска журнала','Укажите статус выпуска журнала. От этого зависит видимость журнала в системе для авторов','Укажите текущий статус выпуска журнала. \"Открыт для приема статей\" - выпуск будет доступен для авторов, они смогут подавать свои статьи в журнал',9,12,0,0,'2017-05-31 09:50:37','2017-05-31 09:50:37'),(14,'publication_publish_plan','Дата публикации выпуска','Укажите планируемую дату публикации выпуска. Эта информация будет доступна для всех пользователей','Укажите планируемую дату публикации выпуска. Эта информация будет доступна для всех пользователей',9,13,0,0,'2017-05-31 09:51:27','2017-05-31 09:51:27'),(15,'publication_pages_multiplicity','Кратность страниц','Укажите кратность страниц выпуска. Эта информация требуется для корректного формирования общего количества страниц в выпуске.','Укажите кратность страниц выпуска. Как правило, кратность страниц необходима для правильной подготовки журнала к печати. Если выпуск не планируется печатать, укажите \"1\" в качестве кратности.',9,14,0,0,'2017-05-31 09:53:03','2017-05-31 09:53:03'),(16,'publication_introduction','Приветствие','Поприветствуйте авторов: расскажите о выпуске журнала','Поприветствуйте авторов: расскажите о выпуске журнала',9,15,0,0,'2017-05-31 09:53:43','2017-05-31 09:53:43'),(17,'publication_website_cover','Обложка выпуска','Укажите изображение для обложки выпуска. Размеры - не менее 100х150, пропорции - 2:3, тип изображения - .jpg или .png','Укажите изображение для обложки выпуска. Размеры - не менее 100х150, пропорции - 2:3, тип изображения - .jpg или .png',9,16,0,0,'2017-05-31 09:54:56','2017-05-31 09:54:56'),(18,'first_start','Начало работы','С чего начать?','Информация для всех участников системы - с чего начать?',0,0,0,0,'2017-06-13 14:49:04','2017-06-19 12:19:59'),(19,'begin_for_author','С его начать автору?','Зарегистрируйтесь в системе, выберите журнал, в нём выберите готовящийся выпуск и направьте в редколлегию Вашу статью','Зарегистрируйтесь в системе, выберите журнал, в нём выберите готовящийся выпуск и направьте в редколлегию Вашу статью',18,0,0,0,'2017-06-20 08:48:22','2017-06-20 08:51:56'),(20,'begin_new_chief_editor','С чего начать редактору?','Зарегистрируйтесь в системе, создайте новый журнал, добавьте для него новый выпуск, откройте выпуск для авторов и разошлите авторам приглашения.','Зарегистрируйтесь в системе, создайте новый журнал, добавьте для него новый выпуск, откройте выпуск для авторов и разошлите авторам приглашения.',18,0,0,0,'2017-06-20 08:49:58','2017-06-20 11:17:05'),(21,'begin_new_proofreader','С чего начать корректору?','Зарегистрируйтесь в системе, откройте журнал, выберите выпуск журнала и подайте заявку на участие в редактуре выпуска','Зарегистрируйтесь в системе, откройте журнал, выберите выпуск журнала и подайте заявку на участие в редактуре выпуска',18,20,0,0,'2017-06-20 08:51:00','2017-06-20 08:51:18');
